import 'dart:convert';

import 'document.dart';
import 'economic_evaluation.dart';
import 'id_image.dart';
import 'image.dart';
import 'property_document.dart';
import 'property_image.dart';

class Data {
	int? id;
	int? userId;
	String? propertyType;
	String? area;
	int? numberOfRooms;
	int? numberOfBathrooms;
	int? propertyAge;
	String? decoration;
	String? kitchenType;
	String? flooringType;
	int? overlookFrom;
	String? balconySize;
	String? paintingType;
	String? price;
	String? payWay;
	String? state;
	String? exactPosition;
	String? contract;
	int? legalCheck;
	int? expertCheck;
	int? accept;
	DateTime? createdAt;
	DateTime? updatedAt;
	List<PropertyImage>? propertyImage;
	List<PropertyDocument>? propertyDocument;
	List<IdImage>? idImage;
	List<Image>? images;
	List<Document>? documents;
	List<IdImage>? idImages;
	String? noteAdmin;
	EconomicEvaluation? economicEvaluation;

	Data({
		this.id, 
		this.userId, 
		this.propertyType, 
		this.area, 
		this.numberOfRooms, 
		this.numberOfBathrooms, 
		this.propertyAge, 
		this.decoration, 
		this.kitchenType, 
		this.flooringType, 
		this.overlookFrom, 
		this.balconySize, 
		this.paintingType, 
		this.price, 
		this.payWay, 
		this.state, 
		this.exactPosition, 
		this.contract, 
		this.legalCheck, 
		this.expertCheck, 
		this.accept, 
		this.createdAt, 
		this.updatedAt, 
		this.propertyImage, 
		this.propertyDocument, 
		this.idImage, 
		this.images, 
		this.documents, 
		this.idImages, 
		this.noteAdmin, 
		this.economicEvaluation, 
	});

	factory Data.(Map<String, dynamic> data) {
		return Data(
			id: data['id'] as int?,
			userId: data['user_id'] as int?,
			propertyType: data['property_type'] as String?,
			area: data['area'] as String?,
			numberOfRooms: data['number_of_rooms'] as int?,
			numberOfBathrooms: data['number_of_bathrooms'] as int?,
			propertyAge: data['property_age'] as int?,
			decoration: data['decoration'] as String?,
			kitchenType: data['kitchen_type'] as String?,
			flooringType: data['flooring_type'] as String?,
			overlookFrom: data['overlook_from'] as int?,
			balconySize: data['balcony_size'] as String?,
			paintingType: data['painting_type'] as String?,
			price: data['price'] as String?,
			payWay: data['pay_way'] as String?,
			state: data['state'] as String?,
			exactPosition: data['exact_position'] as String?,
			contract: data['contract'] as String?,
			legalCheck: data['legal_check'] as int?,
			expertCheck: data['expert_check'] as int?,
			accept: data['accept'] as int?,
			createdAt: data['created_at'] == null
						? null
						: DateTime.parse(data['created_at'] as String),
			updatedAt: data['updated_at'] == null
						? null
						: DateTime.parse(data['updated_at'] as String),
			propertyImage: (data['property_image'] as List<dynamic>?)
						?.map((e) => PropertyImage.(e as Map<String, dynamic>))
						.toList(),
			propertyDocument: (data['property_document'] as List<dynamic>?)
						?.map((e) => PropertyDocument.(e as Map<String, dynamic>))
						.toList(),
			idImage: (data['id_image'] as List<dynamic>?)
						?.map((e) => IdImage.(e as Map<String, dynamic>))
						.toList(),
			images: (data['images'] as List<dynamic>?)
						?.map((e) => Image.(e as Map<String, dynamic>))
						.toList(),
			documents: (data['documents'] as List<dynamic>?)
						?.map((e) => Document.(e as Map<String, dynamic>))
						.toList(),
			idImages: (data['id_images'] as List<dynamic>?)
						?.map((e) => IdImage.(e as Map<String, dynamic>))
						.toList(),
			noteAdmin: data['note_admin'] as String?,
			economicEvaluation: data['economic_evaluation'] == null
						? null
						: EconomicEvaluation.(data['economic_evaluation'] as Map<String, dynamic>),
		);
	}



	Map<String, dynamic> () {
		return {
			'id': id,
			'user_id': userId,
			'property_type': propertyType,
			'area': area,
			'number_of_rooms': numberOfRooms,
			'number_of_bathrooms': numberOfBathrooms,
			'property_age': propertyAge,
			'decoration': decoration,
			'kitchen_type': kitchenType,
			'flooring_type': flooringType,
			'overlook_from': overlookFrom,
			'balcony_size': balconySize,
			'painting_type': paintingType,
			'price': price,
			'pay_way': payWay,
			'state': state,
			'exact_position': exactPosition,
			'contract': contract,
			'legal_check': legalCheck,
			'expert_check': expertCheck,
			'accept': accept,
			'created_at': createdAt?.toIso8601String(),
			'updated_at': updatedAt?.toIso8601String(),
			'property_image': propertyImage?.map((e) => e.()).toList(),
			'property_document': propertyDocument?.map((e) => e.()).toList(),
			'id_image': idImage?.map((e) => e.()).toList(),
			'images': images?.map((e) => e.()).toList(),
			'documents': documents?.map((e) => e.()).toList(),
			'id_images': idImages?.map((e) => e.()).toList(),
			'note_admin': noteAdmin,
			'economic_evaluation': economicEvaluation?.(),		};
	}

  /// `dart:convert`
  ///
  /// Parses the string and returns the resulting Json object as [Data].
	factory Data.fromJson(String data) {
		return Data.(json.decode(data) as Map<String, dynamic>);
	}
  /// `dart:convert`
  ///
  /// Converts [Data] to a JSON string.
	String toJson() => json.encode(());
}
